import React from 'react';

// So you now we make an onClick event with first goal registering a console.log() 

class Dock extends React.Component {
    buttonClicked() {
        console.log("button clicked")
    }

    DockClicked = () => {
       let text = document.querySelector(".dock-panel-content")
       var button = document.createElement("button")
       button.innerHTML = "Click Me"
       button.onClick(this.buttonClicked)
       text.replaceWith(button)

    }
    render() {
    return (
        <div className="dock-panel-parent">
        <div className="dock-panel" onClick={this.DockClicked}>
            <div className="search-bar-parent">
                <img className="search-bar-png2" src="/SearchBar.png" alt="-" />
            </div>
            <div className="dock-panel-content">
            <h4 className="oea-text">Omnibox Extension App</h4>
            </div>
        </div>










        <style jsx>{`
        .dock-panel-parent {
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .dock-panel {
                width: 1507px;
                height: 76px;
                font-family: Montserrat;
                font-size: 23px;
                background-color: #000000;
                background-image: linear-gradient(0deg, #000000 0%, #414141 74%);
                position: relative;
                display: flex;
                align-items: center;
                justify-content: center;
